		var loops = earth_vertices.split("L"); // get path loops

		// map values from 2D rectangle to 3D sphere
		var uv2xyz = function(coord) {
			var theta = -0.3208 * 3.1416 * parseFloat(coord[0]) / 128.0;
			var phi = 0.12 * 6.2832 * parseFloat(coord[1]) / 128.0;
			var radius = 10.0;

			var x = Math.cos(theta) * Math.sin(phi) * radius;
			var y = Math.sin(theta) * Math.sin(phi) * radius;
			var z = -Math.cos(phi) * radius;
			var vertex = new THREE.Vector3( x, y, z);
			// console.log(vertex);
			return vertex;
		}

		// for every loop
        var colorr = 0;
		for (var i = 0; i < loops.length; i++) {
			var coordinates = loops[i].split("|");
			var points = [];
			// for every coordinate
			for (var j = 0; j < coordinates.length; j++) {
					var lon_lat = coordinates[j].split(",");
					points.push(uv2xyz(lon_lat));
			}
			// console.log(points);
            colorr = Math.floor(Math.random() * 360); 
			var material = new THREE.LineBasicMaterial( { color: "hsl(" + colorr + ", 100%, 50%)" } );
			var geometry = new THREE.BufferGeometry().setFromPoints( points );
			var line = new THREE.Points( geometry, material );
			line.rotateX(2);
			scene.add( line );
		}

		// animation logic ticks
		var update = function() {
            camera.position.z -= 0.005;
		};

		// objects to screen
		var render = function() {
			renderer.render(scene, camera);
		};

		// tick/render loop
		var loop = function() {
			requestAnimationFrame(loop);
			update();
			render();
			// gyro_controls.update();
		}
		loop();
		</script>
